import React from 'react'
import { Link } from "react-router-dom";

const Header = () => {
    return (
        <div className="App">
            <header>
                <button className="btn btn-outline-info" style={{background: 'gold', shapeMargin: 'circle'}}>
                <Link to={`/`} style={{color: 'black'}}> <i class="arrow right"></i></Link>
                </button>
            </header>
        </div>
    );
}

export default Header;
